import React from "react";
import { useNavigate } from "react-router-dom";

const Navbar = ({ logged, setLogged }) => {
  const navigate = useNavigate();

  const fakeLogFunction = (action) => {
    console.log("action: ", action);
  };

  const handleSection = (path) => {
    fakeLogFunction("click on " + path);
    navigate(path);
  };

  const loginHandler = () => {
    fakeLogFunction("click on login");
    setLogged(true);
  };

  const logoutHandler = () => {
    fakeLogFunction("click on logout");
    navigate("/");
    setLogged(false);
  };

  return (
    <div style={{ height: 50, width: "100%", backgroundColor: "gray" }}>
      <div style={{ display: "flex", justifyContent: "space-between" }}>
        <div>Navbar</div>
        <br />
        <div>
          {logged ? (
            <>
              <button onClick={() => handleSection("Component1")}>
                Component 1
              </button>
              <button onClick={() => handleSection("Component2")}>
                Component 2
              </button>
              <button onClick={() => handleSection("Component3")}>
                Component 3
              </button>
              <button onClick={() => handleSection("Component4")}>
                Component 4
              </button>
              <button onClick={() => logoutHandler()}>Log Out</button>
            </>
          ) : (
            <>
              <button onClick={() => loginHandler()}>Log In</button>
            </>
          )}
        </div>
      </div>
    </div>
  );
};

export default Navbar;
